import Container from "react-bootstrap/Container";
import VehicleCard from "../components/VehicleCard.js";
import VehicleSearchBar from "../components/VehicleSearchBar.js";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import VehiclesCardrousel from "../sections/VehiclesCardrousel.js";

export const Vehicles = () =>
{
    return (
        <main>
          
     
                <VehicleSearchBar/>
              
          
            <Row>
                <Col className="bg-light">1 of 3</Col>
                <Col xs={8} className="d-flex justify-content-around">
            <Row>
                <Col>
                <VehicleCard />
                </Col>
                <Col>
                <VehicleCard />
                </Col>
                <Col>
                <VehicleCard />
                </Col>
                <Col>
                <VehicleCard />
                </Col>
            </Row>
            </Col>
                <Col className="bg-light">3 of 3</Col>
            </Row>
        </main>
    )
}

export default Vehicles;
